import ReactDOM from 'react-dom';
import './index.css';

import App from './App';
import {MenuContainer, MenuBrick, Header} from './Components.js';


var menuList = {name: "Strona Główna",
                  name: "Dotychczasowe Imprezy",
                  name: "Cennik",
                  name: "O Mnie"};



ReactDOM.render(<App />,
                <Header />,
                <MenuContainer />,
                document.getElementById('root'));
